script: |
  super -f text -I q13299.spq | sort > q13299.out

inputs:
  - name: q13299.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + col1 + + col0 NOT BETWEEN + - col2 * - col1 + - 16 * 40 * + - 86 AND col0 - - 63 * 18 / - col1 / - + col1;
  - name: tab1

outputs:
  - name: q13299.out
    data: |
      51	14	96
      85	5	59
      91	47	68
